import React from 'react';
import './Header.scss';


const Header = props => {
    return (
        <header>
            <div className="container__img-title">
                <h1 className="title" style={{background: 'https://help.redbubble.com/hc/article_attachments/360002309526/Rick_and_Morty_-_logo__English_.png'}}>Rick y Morty Wiki</h1>
                <img src="https://help.redbubble.com/hc/article_attachments/360002309526/Rick_and_Morty_-_logo__English_.png" alt="Rick and Morty Wiki"></img>
            </div>
        </header>
    );
};


export default Header;
